export default function TeamSlider({ data, mt, oneRow = false }) {
  //* random sort non funziona più per problemi con renderizzazione client server
  //* se si vuole aggiungere il sort random lato server c'è il plugin https://market.strapi.io/plugins/strapi-plugin-random-sort
  //* altrimenti si può creare un'api custom su strapi per farlo https://stackoverflow.com/questions/65218433/how-to-get-random-records-from-strapi-content-api
  const boxes = data ? data : teamImages;
  // const shuffledBoxes = boxes.sort( () => Math.random() - 0.5)

  const indexToSplit = Math.floor(boxes.length / 2);
  
  const first = boxes.slice(0, indexToSplit);
  const second = boxes.slice(indexToSplit);
  first.push(...first);
  second.push(...second);

  const sliderFirst = useRef();
  const sliderSecond = useRef();
  const [windowWidth, setWindowWidth] = useState(null);
  const [firstSliderWidth, setFirstSliderWidth] = useState(null);
  const [secondSliderWidth, setSecondSliderWidth] = useState(null);
  useEffect(() => {
    const handleResize = () => {
        setWindowWidth(window.innerWidth);
    };
  
    window.addEventListener('resize', handleResize);
    setWindowWidth(window.innerWidth);
    setFirstSliderWidth(sliderFirst.current.clientWidth);
    if (oneRow === false) {
      setSecondSliderWidth(sliderSecond.current.clientWidth);
    }
  
    return () => {
        window.removeEventListener('resize', handleResize);
    };
  }, []); 

  return (
    <Container mt={mt}>
      {
        (oneRow === true) ?
          <SliderWrapper>
            <Slider className="first" oneRow={oneRow} windowWidth={windowWidth} ref={sliderFirst} firstSliderWidth={firstSliderWidth} secondSliderWidth={secondSliderWidth}>
              {boxes.map((el, idx) => (
                <TeamCard className="team-card" key={idx}>
                  <ContentWrapper>
                    <Image 
                      fill 
                      sizes="100%" 
                      src={el.attributes.immagine && getPath(el.attributes.immagine.data.attributes.url)} 
                      alt={el?.attributes?.immagine?.data?.attributes?.alternativeText ? el.attributes.immagine.data.attributes.alternativeText : el?.attributes?.nome ? el?.attributes?.nome : "Team Member Netstrategy"}
                      // src="data:image/png;base64," 
                      alt={el.attributes.nome}
                      // priority
                      placeholder="blur"
                      //fallback url
                      blurDataURL="data:image/jpeg;base64,"
                    >
                    </Image>
                    <InfoContainer>
                      <Info>
                        <span>{el.attributes.nome}</span>
                        <span>{el.attributes.ruolo}</span>
                      </Info>
                    </InfoContainer>
                  </ContentWrapper>
                </TeamCard>
              ))}
            </Slider>
          </SliderWrapper>
        :
          <>
            <SliderWrapper>
              <Slider className="first" windowWidth={windowWidth} ref={sliderFirst} firstSliderWidth={firstSliderWidth} secondSliderWidth={secondSliderWidth}>
                {first.map((el, idx) => (
                  <TeamCard className="team-card" key={idx}>
                    <ContentWrapper>
                      <Image 
                        fill 
                        sizes="100%" 
                        src={el.attributes.immagine && getPath(el.attributes.immagine.data.attributes.url)} 
                        alt={el?.attributes?.immagine?.data?.attributes?.alternativeText ? el.attributes.immagine.data.attributes.alternativeText : el?.attributes?.nome ? el?.attributes?.nome : "Team Member Netstrategy"}
                        // src="data:image/png;base64," 
                        alt={el.attributes.nome}
                        // priority
                        placeholder="blur"
                        //fallback url
                        blurDataURL="data:image/jpeg;base64,"
                      >
                      </Image>
                      <InfoContainer>
                        <Info>
                          <span>{el.attributes.nome}</span>
                          <span>{el.attributes.ruolo}</span>
                        </Info>
                      </InfoContainer>
                    </ContentWrapper>
                  </TeamCard>
                ))}
              </Slider>
            </SliderWrapper>
            <SliderWrapper>
              <Slider className="second" windowWidth={windowWidth} ref={sliderSecond} firstSliderWidth={firstSliderWidth} secondSliderWidth={secondSliderWidth}>
                {second.map((el, idx) => (
                  <TeamCard className="team-card" key={idx}>
                    <ContentWrapper>
                      <Image 
                        fill 
                        sizes="100%" 
                        src={el.attributes.immagine && getPath(el.attributes.immagine.data.attributes.url)} 
                        alt={el?.attributes?.immagine?.data?.attributes?.alternativeText ? el.attributes.immagine.data.attributes.alternativeText : el?.attributes?.nome ? el?.attributes?.nome : "Team Member Netstrategy"}
                        // src="data:image/png;base64," 
                        alt={el.attributes.nome}
                        // priority
                        placeholder="blur"
                        blurDataURL="data:image/jpeg;base64,"
                      >
                      </Image>
                      <InfoContainer>
                        <Info>
                          <span>{el.attributes.nome}</span>
                          <span>{el.attributes.ruolo}</span>
                        </Info>
                      </InfoContainer>
                    </ContentWrapper>
                  </TeamCard>
                ))}
              </Slider>
            </SliderWrapper>
          </>
      }
      
    </Container>
  )
}

const Container = styled.div`
  margin-top: ${(props) => props.mt};
`

const SliderWrapper = styled.div`
  width: 100%;
  position: relative;
  display: flex;
  align-items: center;
  overflow: hidden;
  height: 340px;
  margin: 2rem 0;
  ${(props) => (!props.oneRow) && 'justify-content: center;'}
`

const Slider = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  display: flex;
  ${(props) => (props.oneRow) && 'position: unset;'}

  &.first {
    ${(props) => (!props.oneRow || props.windowWidth <= 1530) && `animation: teamBannerMove ${props.oneRow ? '50s' : '200s'} linear infinite;`}
    ${(props) => (props.oneRow)
      &&
        '@media screen and (max-width:767px) { animation: teamBannerMoveMobile 20s linear infinite; }'
    }
  }
  &.second {
    transform: ${({secondSliderWidth}) => `translateX(calc(${-secondSliderWidth}px + 100vw));`};
    animation: teamBannerMoveReverse 200s linear infinite;
  }

  /* @media (min-width: 1280px) {
    animation-play-state: ${(props) => (!props.dinamicDesktop && "paused" )};
  } */

  @keyframes teamBannerMoveMobile {
    0% {
      transform: translateX(650px);
    }
    50% {
      transform: translateX(-650px);
    }
    100% {
      transform: translateX(650px);
    }
  }

  @keyframes teamBannerMove {
    0% {
      transform: translateX(-0);
    }
    50% {
      transform: ${({firstSliderWidth}) => `translateX(calc(${-firstSliderWidth}px + 100vw));`}
    }
    100% {
      transform: translateX(-0);
    }
  }
  @keyframes teamBannerMoveReverse {
    0% {
      transform: transform: ${({secondSliderWidth}) => `translateX(calc(${-secondSliderWidth}px + 100vw));`};
    }
    50% {
      transform: translateX(0);
    }
    100% {
      transform: transform: ${({secondSliderWidth}) => `translateX(calc(${-secondSliderWidth}px + 100vw));`};
    }
  }
`

const TeamCard = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  height: 340px;
  aspect-ratio: 4 / 5;
  margin: 0;
  padding: 0;
  flex-shrink: 0;
  color: black;
  font-size: 21px;
  padding: 0 1rem;
  user-select: none;
  img{
    object-fit: cover;
  }
`

const InfoContainer = styled.div`
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  padding: 1rem;
`;

const Info = styled.div`
  padding: 0.4rem 1rem;
  border-radius: 99px;
  backdrop-filter: blur(10px);
  transition: opacity 350ms ease;

  span {
    display: block;
    font-family: ${({ theme: { fonts } }) => fonts.medium};
    font-size: ${({ theme: { fontSizes } }) => fontSizes.size_16_20};
    text-transform: uppercase;
    color: white;
    font-size: 0.7rem;
  }
`;

const ContentWrapper = styled.div`
  width: 100%;
  height: 100%;
  position: relative;
  border-radius: 25px;
  overflow: hidden;
`
